name: 伪娘分级（来自推）
description: 该目录名为“伪娘分级（来自推）”，主要收录与中国大陆地区的伪娘文化相关的讨论和资料。从文件名称中可以看出，这些资料可能涉及到伪娘的身份认同、社群构建以及在社会中面对的挑战和经历。目录内包含多张照片，这些照片可能展示了伪娘群体的日常生活、形象展示或者参与社群活动的瞬间。通过这些视觉资料，可以更直观地了解到伪娘文化的丰富性以及背后所承载的情感和故事。这一目录试图为跨性别及伪娘群体提供一个展示自我的平台，同时也可能涉及对伪娘身份和形象的剖析，以及社会对这一群体的认知和反馈。
